import React from 'react'
import { Link } from 'react-scroll/modules';

function Header() {
  return (
    <section className='header'>
      <nav className='navbar'>
        <ul className='list'>
          <li> A Propos</li>
          <li> Preinscription </li>
          <li> Contact</li>
        </ul>
      </nav>

    </section>
  )
}

export default Header
